import React from 'react';
import Accordion from './Accordion';

const Section = props => {
    return (
        <div ui inverted segment>
            <div className="ui divider"></div>
            <Accordion 
                title={props.title}
                body1={props.body1}
                body2={props.body2}
                body3={props.body3}
                body4={props.body4}
            />
            <div className="ui inverted accordion">
                <div className="active title">
                    <i className="dropdown icon"></i>
                    {props.title}
                </div>
                <div className="active content">
                    <img className="ui large image" alt="" src={props.image}/>
                    <div className="ui divider"></div>
                    <p>{props.body1}</p>
                    <p>{props.body2}</p>
                    <p>{props.body3}</p>
                    <p>{props.body4}</p>
                </div>
            </div>
        </div>
    );
};

export default Section;
